        public static async Task SeedFitnessPrograms(ApplicationDbContext context)
        {
            if (!context.FitnessPrograms.Any())
            {
                await context.Database.ExecuteSqlRawAsync("SET IDENTITY_INSERT Exercises ON");
                var fitnessPrograms = new List<FitnessProgram>
                {
            new FitnessProgram { Name = "Weightlifting Program", Description = "Budujte silu a svaly so štruktúrovaným programom zameraným na odpor a progresívne preťaženie.", NazovObrProgram = "weightliftingimg.png" },
            new FitnessProgram { Name = "Bodyweight Program", Description = "Dosiahnite svoje fitness ciele pomocou dynamických cvikov bez potreby vybavenia, ideálnych na domáci tréning.", NazovObrProgram = "bodyweightimg.webp" },
            new FitnessProgram { Name = "HIIT Program", Description = "Maximalizujte spaľovanie kalórií a vytrvalosť s vysokointenzívnym intervalovým tréningom, ktorý kombinuje výbuchy úsilia s krátkymi prestávkami.", NazovObrProgram = "hiitimg.webp" }
        };

                await context.FitnessPrograms.AddRangeAsync(fitnessPrograms);
                await context.SaveChangesAsync();

            }
        }

